    //     console.log(data);
    //     setResults(data);
    //   })
    //   .catch((error) => {
    //     console.error("Error:", error);
    //   });
  };



return (

  <form onSubmit={handleSearch}>
    <input
      type="text"
      placeholder="Search..."
      value={query}
      name="query"
      onChange={handleInputChange}
    />

      <button type="submit">Search</button>

{results.map((result) => (
            <div key={result.id}>
              <p>{result.name}</p>
              <p>{result.email}</p>
              <p>{result.education}</p>
              <p>{result.contactNumber}</p>
              <p>{result.primelocation}</p>
            
            </div>
          ))}

</form>
)
}

export default Assigntutor;

